import { React } from 'react';
import {Link, NavLink} from 'react-router-dom';

function Nav(props){

    return(
        <nav className="nav">
        <div className="link">
        <Link className="home" to="/home">Home</Link>
        <Link className="home" to="/products">Products</Link>
        <Link className="home" to="/settings">Settings</Link>
        </div>
        </nav>
    )
}

export default Nav;
